import Header from '../components/header';
import Footer from '../components/footer';
import CalInfo from '../components/calinfo';

export default function Home() {
  return (
    <React.Fragment>
    <div className={classes.appMain}>
      <Header />
      <CalInfo />
      <Footer />
    </div>
  </React.Fragment>
  )
}
